import React from 'react';
import { Card, CardContent } from '@mui/material';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';

import myImage1 from '../../../images/cswmo.png';
import myImage2 from '../../../images/9.png';
import myImage3 from '../../../images/hope.png';
import myImage4 from '../../../images/cee.png';
import myImage5 from '../../../images/5.png';

const cardStyle = {
  backgroundColor: '#19506e',
};

const imageStyle = {
  display: 'block',
  margin: '0 auto',
  border: 'none',
  borderRadius: '10px',
  maxWidth: '100%',
  width: '450px',
  height: 'auto',
  boxShadow: '0 0 20px white',
};

const AboutCard = () => {
  return (
    <Carousel infiniteLoop autoPlay showThumbs={false} interval={3000} showStatus={false}>
      <div>
        <Card style={cardStyle}>
          <CardContent>
            <img src={myImage1} alt="Image 1" style={imageStyle} />
            {/* Card content here */}
          </CardContent>
        </Card>
      </div>
      <div>
        <Card style={cardStyle}>
          <CardContent>
            <img src={myImage2} alt="Image 2" style={imageStyle} />
            {/* Card content here */}
          </CardContent>
        </Card>
      </div>
      <div>
        <Card style={cardStyle}>
          <CardContent>
            <img src={myImage3} alt="Image 3" style={imageStyle} />
            {/* Card content here */}
          </CardContent>
        </Card>
      </div>
      <div>
        <Card style={cardStyle}>
          <CardContent>
            <img src={myImage4} alt="Image 4" style={imageStyle} />
            {/* Card content here */}
          </CardContent>
        </Card>
      </div>
      <div>
        <Card style={cardStyle}>
          <CardContent>
            <img src={myImage5} alt="Image 5" style={imageStyle} />
            {/* Card content here */}
          </CardContent>
        </Card>
      </div>
    </Carousel>
  );
};

export default AboutCard;
